import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from '../components/Header';
import Footer from '../components/Footer';
import Home from './Home';
import About from './About';
import Pricing from './Pricing';
import Gigs from './Gigs';
import Login from './Login';
import Register from './Register';
import Contact from './Contact';
import './App.css';

function App() {
  return (
    <div className="app">
      <header>
        <nav>
          <a href="/" className="active">Početna</a>
          <a href="/svirke">Svirke</a>
          <a href="/cjenovnik">Cjenovnik</a>
          <a href="/o-nama">O nama</a>
        </nav>

        <div className="header-center">BACKSTAGE CAFFE</div>

        <div style={{ width: '100px' }}></div>
      </header>

      <main className="app-content">
        {/* Ovde ide sadržaj stranice */}
      </main>

      <footer>
        <div className="footer-socials">
          <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">Instagram</a>
          <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">Facebook</a>
          <a href="https://twitter.com" target="_blank" rel="noopener noreferrer">Twitter</a>
        </div>

        <div className="footer-logo">Backstage</div>

        <div className="footer-bottom">&copy; 2025 Prava zadržana Backstage</div>
      </footer>
    </div>
  );
}

export default App;
